import './App.css';

function AccountForm() {
    return (
        <>
        <form className='form'>
            <div className="mb-3">
                <label htmlFor="email" className="form-label">Email address</label>
                <input required type="email" className="form-control" id="email" placeholder="name@example.com" />
            </div>
            <div className="mb-3">
                <label htmlFor="name" className="form-label">Name</label>
                <input required type="text" className="form-control" id="name" placeholder="Your name here" />
            </div>
            <div className="mb-3">
                <label htmlFor="password" className="form-label">Password</label>
                <input required type="password" className="form-control" id="name" placeholder="Your password here" />
            </div>
        </form>
        </>
    );
}

export default AccountForm;
